import React from 'react'

const ChannelDetails = () => (

    <Box sx={{ borderRadius:'20px',boxShadow:'none' }}>

      <Link to={`/channel/${ChannelDetails?.id?.ChannelId}`}>
        <CardContent sx={{ display:'flex',flexDirection:'column',color:'#fff',justifyContent:'center',alignItems:'center' }}>

        <CardMedia 
         image={ChannelDetails?.snippet?.thumbnails?.high?.url||demoProfilePicture}
         alt={ChannelDetails?.snippet?.title}
         sx={{  width:'180px',height:'180px',borderRadius:'50%'  }}
        
        />

        </CardContent>
       
       
      </Link>
    </Box>
  )


export default ChannelDetails
